import React, { useState } from 'react';
import { Paper, Typography, Button } from '@material-ui/core';
import './Appointment.css'; // Import your DoctorList CSS file

const Appointment = ({ doctor }) => {

  //using doctor uuid fetch all pointmetns

  // current time > data then only show appointments

  const doctorsAppointments = [
    { name: 'Devraj', date: '21-02-2024', symptoms: "Fever", p: "Fever" },
    { name: 'Raman', date: '21-02-2024', symptoms: "Cough" },
    { name: 'Surya', date: '2-02-2024', symptoms: "Headache, fever" },
    { name: 'Gowri', date: '12-09-2024', symptoms: "Eye pain, neck pain" },
  ];

  return (
    <div className="DoctorsAppointmentTab">
      {doctorsAppointments.map((doctorAppointment, index) => (
        <Paper key={index} elevation={3} className="doctor-paper">
          <Typography variant="h6">Doctor Name: {doctorAppointment.name}</Typography><br/>
          <Typography variant="subtitle1">Speciality: {doctorAppointment.date}</Typography>
          <Typography variant="subtitle1">Average Rating: {doctorAppointment.rating}</Typography>
        </Paper>
      ))}
      </div>
  );
};

export default Appointment;
